clear all; close all; clc;


%[text] ![](text:image:4694)
%[text] 
%%
%[text] 初始化参数和状态
tic;

global params states_r

fprintf('1. 初始化参数和状态...\n'); %[output:882911f9]
params = init_params(); 
states_r = struct();
Y0 = init_Y();

params.disease_type=1; %@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
params.disease_Healthy=0;
params.disease_GNAT1=1; %先天性夜盲
params.disease_PDE6AB=2;
if(params.disease_type==params.disease_GNAT1)
    params.kG1_0 = 0;
elseif(params.disease_type==params.disease_PDE6AB)
    params.betasub = 0;
end

toc; %[output:09747ba3]
%%
%[text] 仿真设置
tic;

fprintf('仿真设置...\n'); %[output:91de9346]

t_total = 5.0; % s
flash_start = 0.5; % s
flash_duration = 0.02; % s
light_intensities = [1.7, 4.8, 15.2, 39.4, 125, 444, 1406, 4630];

% 添加光刺激参数到params结构体
params.flash_start = flash_start;
params.flash_duration = flash_duration;
params.stimulus = 0; % 初始为0

% ODE 求解器选项 - 使用更严格的容差
options = odeset('RelTol', 1e-6, 'AbsTol', 1e-9, ...
                 'MaxStep', 0.001, ...  % 限制最大步长
                 'InitialStep', 1e-6);  % 使用小的初始步长

% options = odeset('RelTol', 1e-6, 'AbsTol', 1e-9, ...
%                  'MaxStep', 0.001, ...  % 限制最大步长
%                  'InitialStep', 1e-6);  % 使用小的初始步长

toc; %[output:46c71089]
%%
%[text] 寻找暗环境稳态 （可选）
tic;

fprintf('2. 寻找暗环境稳态...\n'); %[output:0f6262da]
params.Jhv = 0;

dark_results = cell(1, 1);
dark_t_results = cell(1, 1);

% 分步达到稳态，避免数值不稳定
[t_ss1, Y_ss1] = ode15s(@dY_dt, [0 0.1], Y0, options);
[t_ss2, Y_ss2] = ode15s(@dY_dt, [0.1 1], Y_ss1(end,:), options);
[t_ss3, Y_ss3] = ode15s(@dY_dt, [1 5], Y_ss2(end,:), options);
% [t_ss3, Y_ss3] = ode15s(@dY_dt, [1 300], Y_ss2(end,:), options);
Y_steady_state = Y_ss3(end, :);

% 保存Y_steady_state
save('Y_steady_state.mat', 'Y_steady_state');

% 暗稳态结果
dark_t_results{1} = t_ss3;
dark_results{1} = unpack_solution_to_results(t_ss3, Y_ss3, 0);
% analyze_and_print_results(dark_results, dark_t_results, 0);
plot_final_results_figure(dark_results, dark_t_results,[0, 5]); %[output:007cd428]

% 稳态验证
steady_state_check = struct();
steady_state_check.Vm = Y_steady_state(1);
steady_state_check.cGMP = Y_steady_state(18);
steady_state_check.Caos = Y_steady_state(9);
steady_state_check.Cais = Y_steady_state(10);
steady_state_check.Ki = Y_steady_state(6);
steady_state_check.Nai = Y_steady_state(7);

fprintf('\n稳态检查：\n'); %[output:1b340b53]
fprintf('  Vm = %.2f mV (期望?: -40 mV)\n', steady_state_check.Vm); %[output:206ae603]
fprintf('  cGMP = %.2f μM (期望?: 6.5 μM)\n', steady_state_check.cGMP); %[output:72b27cc7]
fprintf('  Caos = %.3f μM (期望?: 0.25 μM)\n', steady_state_check.Caos); %[output:62e879cb]
fprintf('  Cais = %.3f μM (期望?: 0.1 μM)\n', steady_state_check.Cais); %[output:1cd3b111]
fprintf('  Ki = %.1f mM (期望?: 140 mM)\n', steady_state_check.Ki); %[output:23369934]
fprintf('  Nai = %.1f mM (期望?: 5-15 mM)\n', steady_state_check.Nai); %[output:2f34e2aa]

% 计算暗电流
currents_ss = cal_ion_currents();
fprintf('  暗电流 = %.2f pA (期望: ~-20 pA)\n', currents_ss.I_CNG + currents_ss.I_NCKX); %[output:0c1c2294]
fprintf('   稳态达成！\n\n'); %[output:44301e0d]

toc; %[output:50b63d22]
%%
%[text] 循环运行不同光强的仿真
tic;

fprintf('3. 开始进行光响应仿真...\n'); %[output:47c71753]
load('Y_steady_state.mat');

results = cell(length(light_intensities), 1);
t_results = cell(length(light_intensities), 1);

for i = 1:length(light_intensities) %[output:group:21177cbc]
    J_hv = light_intensities(i);
    fprintf('   仿真 %d/%d: 光强 = %.1f photons/μm²/s\n', i, length(light_intensities), J_hv); %[output:34c2cd75]
    
    % 设置当前光强
    params.Jhv = J_hv;
    
    % 运行完整仿真（让derivatives函数内部处理光刺激时序）
    [t_full, Y_full] = ode15s(@dY_dt, [0, t_total], Y_steady_state, options);
    
    t_results{i} = t_full;
    results{i} = unpack_solution_to_results(t_full, Y_full, J_hv);

end %[output:group:21177cbc]

fprintf('\n4. 打印关键时间点的数据...\n'); %[output:3c43108d]
analyze_and_print_results(results, t_results, light_intensities); %[output:5ad535bb]

toc; %[output:4886c03f]
%%
%[text] 绘图
tic;

fprintf('4. 绘制结果...\n'); %[output:6adc59a4]
plot_final_results_figure(results, t_results,[0, 5]); %[output:9c1ab938]



fprintf('仿真完成！\n'); %[output:565a3d09]

toc; %[output:974cbe31]

%%
%[text] figure 1 healthy mouse (disease=0) & unhealthy mouse (disease=1)
figure; %[output:19981675]

t=t_results{8};
Vm_mV=results{8}.Vm;
Jhv=light_intensities(8);
cGMP=results{8}.cGMP;
pOpen_CNG=cal_pOpen_CNG(results{8});

stimulus = zeros(length(t), 1);

for i = 1:length(t)
    if t(i) >= params.flash_start && t(i) <= (params.flash_start + params.flash_duration)
        stimulus(i) = Jhv * 0.43 ;
    end
end

set(gcf, 'Position', [100, 100, 1600, 900]); %[output:19981675]

subplot(4,1,1); %[output:19981675]
plot(t,stimulus); % 改变线的粗细 %[output:19981675]
title('Light Intensity'); %[output:19981675]
xlabel('t(s)'); %[output:19981675]
ylabel('Jhv*0.43 (photons/μm²/s)'); %[output:19981675]

subplot(4,1,2); %[output:19981675]
plot(t,cGMP); %[output:19981675]
xlabel('t(s)'); %[output:19981675]
ylabel('cGMP (μM)'); %[output:19981675]

subplot(4,1,3); %[output:19981675]
plot(t,pOpen_CNG); %[output:19981675]
xlabel('t(s)'); %[output:19981675]
ylabel('pOpen_CNG'); %[output:19981675]

subplot(4,1,4); %[output:19981675]
plot(t,Vm_mV); %[output:19981675]
title('Membrane Potential'); %[output:19981675]
xlabel('t(s)'); %[output:19981675]
ylabel('Vm (mV)'); %[output:19981675]

ax = findall(gcf, 'Type', 'axes');        % 获取当前图中所有 axes 对象
set(ax, 'YLimMode', 'auto');  %[output:19981675]
set(ax, 'YLimitMethod', 'padded'); %[output:19981675]
%[text] 
% modify




if(params.disease_type==params.disease_PDE6AB) %[output:group:455b25a3]
    subplot(4,1,2); %[output:19981675]
    ylim([0.5 7.01]); %[output:19981675]

    subplot(4,1,3); %[output:19981675]
    ylim([-0.005 0.065]); %[output:19981675]

    subplot(4,1,4); %[output:19981675]
    ylim([-57.5 -35]); %[output:19981675]
end %[output:group:455b25a3]





